This was a message I got today after one of my stories. 

Being an entrepreneur for 7 years has given me thick skin and I thankful don‚Äôt let other‚Äôs misunderstandings bother me. 

This one didn‚Äôt bother me, but I do feel the need to educate as there are so many stigmas around mental illnesses. 

Unfortunately those who‚Äôve never dealt with anxiety are under the impression that it‚Äôs a mental thing and those with it can just ‚Äúsnap out of it.‚Äù 

Which couldn‚Äôt be the farthest from the truth. 

I‚Äôm pretty damn mentally strong, so if that were the case, I wouldn‚Äôt have dealt with it for 4+ years and possibly will live with it for life. 

Yes, we did just go on the most magical vacation and I AM happy, but I‚Äôm also anxious and extremely tired. 

The last few months have been mentally challenging for me with the kids home for 6 months. 

